1.body:
This chapter gives an informal overview of the Patina language. More precise specifications can be found in the next chapter. A Patina program consists of a list of function definitions, one of is a function called main that acts as the entry point of the program: fn my_function(<arg_name>: <arg_type>) -> <return_type> { ... // body of my_function
} ... // more function definitions fn main() -> unit { ... // body of main
} Patina is an expression-oriented language. This means that Statements (like those in Java or C) don't have a distinguished status in Patina. Instead, everything is an expression; statements are just expressions that don't produce values, and they can be used anywhere an expression can be used. The body of each function is simply an expression (i.e. there are no explicit return statements like in Java or C). Executing a function simply means evaluating the expression that is the body of the function. Let's see what kinds of expressions we can write in Patina.

14.body:
Aliasing is permitted in Patina. Two array variables can simultaneously refer to the same array object: { let xs: [int] = alloc(1); let ys: [int] = xs; // ys refers to the same array as xs ...
} Arrays are passed by reference. So [int] is like a pointer to integer (int *) in C++. In the following example, both reverse_1 and reverse_2 reverses the input array. However, reverse_1 modifies the input array in place , while reverse_2 returns a new array that's the reverse of the input array. fn reverse_1(xs: [int], len: int) -> unit { let mid: int = len / 2; let i: int = 0; while i < mid { xs[i] = xs[len - i - 1]; i = i + 1 }
} fn reverse_2(xs: [int], len: int) -> [int] { let ys: [int] = alloc(len); let i: int = 0; while i < len { ys[i] = xs[len - i - 1]; i = i + 1 }; ys
}

15.body:
Because you're not required to implement a garbage collector for your compiler, arrays will have infinite extent. In other words, an array cannot be destroyed once it has been allocated. In the following example, even after the function f has returned, the array referred to by xs inside the body of f continues to exist in heap memory. But we can't access the array again, because its only name xs is no longer available outside the function body: fn f() -> unit { let xs: [int] = alloc(1); // xs refers to an array in heap memory ()
} fn main() -> unit { f(); ... // can't refer to that array anymore, since xs is out-of-scope
} Once we've created an array, unless we always remember its name (or one of its names), the array would become an unnameable identity forever lost in heap memory. This is what's called a memory leak , which plagues programs written in unmanaged languages like C and C++. You will learn about solutions to this problem in the second half of the course, although you won't be required to implement them [1] . Also, learn how Rust prevents resource leaks using a completely different approach . It's super cool!

17.body:
Functions can be recursive. This program will print out 55, the tenth fibonacci number (indexing from zero). fn fibonacci(x: int) -> int { if x == 0 || x == 1 then { x } else { fibonacci(x-1) + fibonacci(x-2) }
} fn main() -> unit { print_int(fibonacci(10))
} You can also define mutually recursive functions: fn even(x: int) -> bool { x == 0 || odd(x - 1)
} fn odd(x: int) -> bool { x == 1 || even(x - 1)
} fn main() -> unit { print_bool(odd(3))
} This program will print out true.

4.body:
Patina supports if-then-else expressions , which evaluates to the then-expression when the condition expression evaluates to true or the else-expression otherwise. For example, the expression if 0 <= 1 then { 2 + 3
} else { 3 * 4
} evaluates to 5. [1] Note that it is possible to simulate "else if" clauses by nesting multiple if-then-else. For example, if 0 == 1 then { 3
} else { if 0 == 2 then { 5 } else { 7 }
} evaluates to 7. You may have noticed the extra pair of curly braces that enclose the then and the else branch. They are not just there for readability; in fact, { ... } is another kind of expression in Patina, called sequence expressions . You will learn more about them in the next section. For those of you familiar with C++ (or Java), Patina's if-then-else expressions correspond to C++'s conditional expressions. For example, the if-then-else expression here would translate to 0<=1 ? (2+3) : (3*4) in C++. Importantly, Patina's if-then-else expressions are different from C++'s if- statements . Statements don't produce values, but expressions do.

6.body:
It is often useful to string together multiple unit expressions with side effects, and evaluate them one by one. Say we would like to print two integers. In Patina, we can express this using a sequence expression : { print_int(8); print_int(9)
} This should be understood as a single overall expression e written as { e1 ; e2 }. The expression e contains two sub-expressions, namely, print_int(8) as e1 and print_int(9) as e2. To evaluate a sequence expression { e1; e2; ...; en }, we evaluate each ei sequentially, discarding the values of all expressions except for the last expression en. The value of en will become the value of the overall sequence expression. So in the previous example, the value of the overall sequence expression is the value of print_int(9), which is (), the unit value. The value of print_int(8) is suppressed. [1] A sequence has to have at least one expression, but it may very well have just a single expression, as you have encountered in a previous if-then-else expression: if 0 <= 1 then { 2 + 3
} else { 3 * 4
} Here, the then branch contains the sequence { 2 + 3 } consisting of a single expression 2 + 3 (and similarly with the else branch). Sequences also appear as while expressions's body and functions' body, both of which we will introduce shortly.

7.body:
Sequence expressions not only are useful for specifying sequential computation with side effects, but they also delineate how long variables declared inside them should live. Let's first see how variables are declared in Patina. Variable declaration is another kind of side effect in addition to printing to standard output. In Patina, variables are created using let-expressions : let x: T = e This expression will create a new variable x of type T, which is initialized with the value of expression e. Then, x becomes available ("in-scope") in subsequent expressions within the same sequence . For example, { let x: int = 5; let y: int = x + 1; print_int(x * y)
} will print out 30, but { { let x: int = 5; let y: int = x + 1 }; print_int(x * y)
} will result in a compile-time error due to the last line: variables x and y are only available inside the inner sequence, and are not available in the outer sequence. Let-expressions themselves have type unit.

9.body:
Patina's while expressions are very similar to the while loops in other imperative languages like C or Java. A while expression has a condition and a body sequence : while cond { e1; e2; ..; en
} To evaluate a while expression, we first evaluate its condition: If it is true, then we evaluate the body sequence repeatedly until the condition evaluates to false. Otherwise, the body sequence will not be evaluated. For example, { let i: int = 0; while i < 3 { i = i + 1 }; print_int(i)
} will print 3 to the standard output. The condition should have type bool, and the body have type unit. The overall while expression will have type unit. For simplicity, Patina has no break or continue constructs. For those of you familiar with Java or C, the semicolon has a different meaning here. In Java or C, a semicolon signals the end of a simple statement. In Patina, a semicolon is part of the syntax for sequence expressions, so they must appear together with a surrounding pair of curly braces. Moreover, a semicolon is always sandwiched between two expressions, and it means that "we don't care the value of the first expression, but please evaluate it before you evaluate the expression after the semicolon."
